import img from "../public/mac.png";
import Layout from "../components/MyLayout.js";
import MySlider from "../components/Slider";

const Page = () => (
  <div className="main">
    <img src={img} />
    <h1>Title</h1>
    <MySlider />
    <style jsx>
      {`
        .main {
          width: 100%;
          height: 92vh;
          background-color: #25252b;
          display: flex;
          flex-direction: column;
          align-items: center;
          justify-content: center;
          color: #fff;
        }
        p {
          font-size: 2rem;
        }
        img {
          width: 550px;
          height: 350px;
        }
      `}
    </style>
  </div>
);

export default Layout(Page);
